import './Quest_execute.scss';

const Quest_execute = () =>
{
  return (
    <div className="Execute">
      <div className="MainTitle">AI 매매정보 이용하기 </div>
      <div className="SubTitle">
        AI 매매정보를 확인하고 <br /> 수익을 창출해봅시다.</div>
      <div className="Content">
        <div className="Explain">아래 버튼으로 AI 매매정보를 확인해주세요!
        </div>
        <div className="Box-execute">
          <div className='Icon-execute'>("이동하기"아이콘)</div>
        </div>
      </div>
    </div>
  );
};

export default Quest_execute;
